import React, { Component } from 'react'
import './filter.css'

export default class FilterList extends Component {
    render() {
        return (
            <>  
                <div className='filter-container'>
                <h3>This is Filter Block</h3>
                <input type='radio'>f1</input>
                </div>
            </>
        )
    }
}
